import React, { useState } from "react";
import "./App.css";

const API_URL = "http://127.0.0.1:5000";

export default function App() {
  const [file, setFile] = useState(null);
  const [method, setMethod] = useState("AES");
  const [key, setKey] = useState("");
  const [decryptKey, setDecryptKey] = useState("");
  const [loading, setLoading] = useState(false);

  const handleEncrypt = async () => {
    if (!file) return alert("Please select a file first.");
    setLoading(true);
    const formData = new FormData();
    formData.append("file", file);
    formData.append("method", method);

    try {
      const response = await fetch(`${API_URL}/encrypt`, { method: "POST", body: formData });
      const result = await response.json();
      if (result.error) throw new Error(result.error);

      setKey(result.key);

      const downloadRes = await fetch(`${API_URL}/download/${result.filename}`);
      const blob = await downloadRes.blob();
      const a = document.createElement("a");
      a.href = window.URL.createObjectURL(blob);
      a.download = result.filename;
      a.click();
    } catch (err) {
      alert("Encryption failed: " + err.message);
    } finally {
      setLoading(false);
    }
  };

  const handleDecrypt = async () => {
    if (!file || !decryptKey) return alert("Select file and provide key.");
    setLoading(true);
    const formData = new FormData();
    formData.append("file", file);
    formData.append("method", method);
    formData.append("key", decryptKey);

    try {
      const response = await fetch(`${API_URL}/decrypt`, { method: "POST", body: formData });
      if (!response.ok) throw new Error("Decryption failed");
      const blob = await response.blob();
      const a = document.createElement("a");
      a.href = window.URL.createObjectURL(blob);
      a.download = "decrypted_" + file.name;
      a.click();
    } catch (err) {
      alert("Decryption failed: " + err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="cyber-container">
      <h1 className="cyber-title">üîê SecureScan Encryption Suite</h1>
      <div className="cyber-card">
        <label className="cyber-label">
          Upload File:
          <input type="file" onChange={(e) => setFile(e.target.files[0])} />
        </label>

        <label className="cyber-label">
          Encryption Type:
          <select value={method} onChange={(e) => setMethod(e.target.value)}>
            <option value="AES">AES</option>
            <option value="Fernet">Fernet</option>
            <option value="RSA">RSA</option>
          </select>
        </label>

        <div className="cyber-buttons">
          <button onClick={handleEncrypt} disabled={loading}>
            {loading ? "Encrypting..." : "Encrypt"}
          </button>
          <button onClick={handleDecrypt} disabled={loading}>
            {loading ? "Decrypting..." : "Decrypt"}
          </button>
        </div>

        {key && (
          <div className="cyber-keybox">
            <h3>Generated Key:</h3>
            <pre className="terminal-output">{key}</pre>
            <button onClick={() => navigator.clipboard.writeText(key)}>Copy Key</button>
          </div>
        )}

        <label className="cyber-label">
          Paste Key for Decryption:
          <textarea
            rows={3}
            placeholder="Enter your decryption key..."
            value={decryptKey}
            onChange={(e) => setDecryptKey(e.target.value)}
          />
        </label>
      </div>
    </div>
  );
}
